import React from 'react'
import Container from "@material-ui/core/Container"
import Button from "@material-ui/core/Button"
import Accordion from "@material-ui/core/Accordion"
import IconButton from "@material-ui/core/IconButton"
import EditIcon from "@material-ui/icons/Edit"
import ExpandMoreIcon from "@material-ui/icons/ExpandMore"
import AccordionSummary from "@material-ui/core/AccordionSummary"
import AccordionDetail from "@material-ui/core/AccordionDetails"
import ListItemText from "@material-ui/core/ListItemText"


export const Confirmation = (data) => {
 console.log(data)
  const {go } = data.navigation;
    return (
      <Container maxWidth="sm" >
          <h1>Confirmation</h1>
          <RenderAccordion summary="NameAndPhone" 
          go={go}
          details={[{"First name":data.data.firstName},
          {"Last name":data.data.lastName},
          {"Phone number":data.data.phone}
          ]}/>
             <RenderAccordion summary="EmailAndDob" 
              go={go}
             details={[{"E-email":data.data.email},
          {"Date of birth":data.data.dob}
          ]}/>
            <Button 
            variant="contained" 
            fullWidth color="primary" 
            style= {{marginTop:"1rem"}}
            onClick={()=>go("Submit")}
            >
                Submit
            </Button>

      </Container>
    )
}


export const RenderAccordion = ({summary,details,go}) => (
    <Accordion>
        <AccordionSummary
         expandIcon={<ExpandMoreIcon/>}
        >
          {summary}
        </AccordionSummary>
        <AccordionDetail>
            <div>
            {details.map((data,index)=>{
              const keys = Object.keys(data)[0];
              const values = data[Object.keys(data)[0]]

              return <ListItemText key={index}>{`${keys}: ${values}`}</ListItemText>

             })}
             <IconButton
             color="primary"
             component="span"
             onClick={()=>go(`${summary}`)}
             >
                  <EditIcon/>
             </IconButton>
            </div>
        </AccordionDetail>
    </Accordion>
)
